import React from 'react';

const Entry = (props) => {
    return (
        <div>
            <h1 href="#">{props.data.title}</h1>
            <p>First Author ... Last Author</p>
            <p>Date Published</p>
            <h3>Summary</h3>
            <p></p>
        </div>
    )
}


export default Entry;
